const myImage = new Image();
myImage.src =
  "data:image/png;base64,";

myImage.addEventListener("load", function () {
  const canvas = document.getElementById("canvas");
  const context = canvas.getContext("2d");
  canvas.width = 800;
  canvas.height = 960;

  context.drawImage(myImage, 0, 0, canvas.width, canvas.height);
  const pixels = context.getImageData(0, 0, canvas.width, canvas.height);
  context.clearRect(0, 0, canvas.width, canvas.height);

  let particlesArray = [];
  const particlesAmount = 5000;

  let mappedImage = [];
  for (let y = 0; y < canvas.height; y++) {
    let row = [];
    for (let x = 0; x < canvas.width; x++) {
      const red = pixels.data[y * 4 * pixels.width + x * 4];
      const green = pixels.data[y * 4 * pixels.width + (x * 4 + 1)];
      const blue = pixels.data[y * 4 * pixels.width + (x * 4 + 2)];
      const brightness = calculateRelativeBrightness(red, green, blue);
      const cell = [(cellBrightness = brightness)];
      row.push(cell);
    }
    mappedImage.push(row);
  }
  console.log(mappedImage);

  function calculateRelativeBrightness(red, green, blue) {
    return Math.sqrt(red * red * 0.29 + green * green * 0.587 + blue * blue * 0.114) / 100;
  }

  class Particle {
    constructor() {
      this.x = Math.random() * canvas.width;
      this.y = Math.random() * canvas.height;
      this.speed = 0;
      this.velocity = Math.random() * 0.5;
      this.size = Math.random() * 1.5 + 1;
      this.positionY = Math.floor(this.y);
      this.positionX = Math.floor(this.x);
    }

    update() {
      this.positionX = Math.floor(this.x);
      this.positionY = Math.floor(this.y);
      this.speed = mappedImage[this.positionY][this.positionX][0];
      let movement = 2.5 - this.speed + this.velocity;

      this.y += movement;
      if (this.y >= canvas.height) {
        this.y = 0;
        this.x = Math.random() * canvas.width;
      }
    }

    draw() {
      context.beginPath();
      context.fillStyle = "white";
      context.arc(this.x, this.y, this.size, 0, Math.PI * 2);
      context.fill();
    }
  }

  function init() {
    for (let i = 0; i < particlesAmount; i++) {
      particlesArray.push(new Particle());
    }
  }
  init();

  function animate() {
    context.globalAlpha = 0.05;
    context.fillStyle = "rgb(0,0,0)";
    context.fillRect(0, 0, canvas.width, canvas.height);
    context.globalAlpha = 0.2;
    for (let i = 0; i < particlesArray.length; i++) {
      particlesArray[i].update();
      context.globalAlpha = particlesArray[i].speed * 0.5;
      particlesArray[i].draw();
    }
    requestAnimationFrame(animate);
  }
  animate();
});
